import React, { useState } from 'react';
import HomePage from './pages/HomePage';
import BottomNav from './components/BottomNav';

export default function App() {
  const [currentView, setCurrentView] = useState('home');

  return (
    <div className="h-screen bg-white flex flex-col max-w-md mx-auto relative">
      {/* Status Bar */}
      <div className="flex justify-between items-center px-4 py-2 text-xs">
        <span>9:41</span>
        <div className="flex gap-1">
          <div className="w-4 h-3 bg-black rounded-sm" />
          <div className="w-4 h-3 bg-black rounded-sm" />
          <div className="w-4 h-3 bg-black rounded-sm" />
        </div>
      </div>

      {/* Header */}
      <div className="px-4 py-3 border-b-2 border-black">
        <div className="flex items-center gap-2">
          <h1 className="text-2xl font-bold">ShelfMate</h1>
          <div className="w-8 h-8 border-2 border-black rounded flex items-center justify-center">
            <svg className="w-5 h-5" fill="black" viewBox="0 0 24 24">
              <path d="M12 21.35l-1.45-1.32C5.4 15.36 2 12.28 2 8.5 2 5.42 4.42 3 7.5 3c1.74 0 3.41.81 4.5 2.09C13.09 3.81 14.76 3 16.5 3 19.58 3 22 5.42 22 8.5c0 3.78-3.4 6.86-8.55 11.54L12 21.35z"/>
            </svg>
          </div>
        </div>
      </div>

      {/* Main Content */}
      {currentView === 'home' && <HomePage />}
      {currentView === 'favorites' && (
        <div className="flex-1 flex items-center justify-center">
          <p>Favorites Page (Coming Soon)</p>
        </div>
      )}
      {currentView === 'swipe' && (
        <div className="flex-1 flex items-center justify-center">
          <p>Swipe Page (Coming Soon)</p>
        </div>
      )}
      {currentView === 'profile' && (
        <div className="flex-1 flex items-center justify-center">
          <p>Profile Page (Coming Soon)</p>
        </div>
      )}

      {/* Bottom Navigation */}
      <BottomNav 
        currentView={currentView}
        onNavigate={setCurrentView}
      />
    </div>
  );
}
